func TestComparePoolSimulatorV2(t *testing.T) {
	var poolEnt entity.Pool
	err := json.Unmarshal([]byte(poolRedis), &poolEnt)
	require.Nil(t, err)

	sim, err := NewPoolSimulator(poolEnt, valueobject.ChainIDEthereum)
	require.Nil(t, err)

	err = json.Unmarshal([]byte(poolRedisGob), &poolEnt)
	require.Nil(t, err)

	simv2, err := NewPoolSimulatorV2(poolEnt, valueobject.ChainIDEthereum)
	require.Nil(t, err)

	testCases := []struct {
		tokenIn  string
		tokenOut string
		amountIn string
	}{
		{"0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "10000000000000000000000"},
		{"0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "50000000000000010000000"},
		{"0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "500100"},
		{"0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "500000000"},
		{"0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "50000000009200000000"},
		{"0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "9000000230000000000"},
		{"0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "900000845000"},
		{"0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2", "0xf1b99e3e573a1a9c5e6b2ce818b617f0e664e86b", "9000000127"},
	}

	for i, tc := range testCases {
		t.Run(fmt.Sprintf("test %d", i), func(t *testing.T) {
			in := pool.TokenAmount{
				Token:  tc.tokenIn,
				Amount: bignumber.NewBig10(tc.amountIn),
			}

			// v1 and v2 sim should yield same output

			result, err := sim.CalcAmountOut(pool.CalcAmountOutParams{
				TokenAmountIn: in,
				TokenOut:      tc.tokenOut,
				Limit:         nil,
			})
			require.Nil(t, err)

			resultv2, err := simv2.CalcAmountOut(pool.CalcAmountOutParams{
				TokenAmountIn: in,
				TokenOut:      tc.tokenOut,
				Limit:         nil,
			})
			require.Nil(t, err)

			require.Equal(t, result.TokenAmountOut.Amount, resultv2.TokenAmountOut.Amount)
		})
	}
}

func TestTickGob(t *testing.T) {
	x := v3Entities.Tick{Index: 10, LiquidityGross: big.NewInt(324), LiquidityNet: big.NewInt(-8234)}
	y := TickGob{Index: 10, LiquidityGross: (*bignumber.GobBigInt)(big.NewInt(324)), LiquidityNet: (*bignumber.GobBigInt)(big.NewInt(-8234))}
	assert.Equal(t, x, *(*v3Entities.Tick)(unsafe.Pointer(&y)))

	xs := v3TickList{x}
	ys := []TickGob{y}
	assert.Equal(t, xs, *(*v3TickList)(unsafe.Pointer(&ys)))
}
